import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom'

export class TestGroupListItem extends Component {
    render() {
        const testGroup = this.props.item;
        const link = "/testgroups/" + testGroup.id;
        return (
            <div class="divTableRow">
            <div class="divTableCell"><Link to={link}>{testGroup.microservice}</Link></div>
            <div class="divTableCell"><Link to={link}>{testGroup.method}</Link></div>
            <div class="divTableCell"><Link to={link}>{testGroup.path}</Link></div>
            </div>
        )
    }
}


export default TestGroupListItem
